	(7,0,'2020-05-31 07:48:34','2020-05-31 07:48:34','<!-- wp:paragraph -->\n<p> </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The goal of the massive international Cat Tracker project was simple: find out where pet cats go when they’re outside. Researchers have tried to tackle this question in the past, either by following cats on foot (good luck!) or by putting radio-transmitters on collars around cats’ necks, but Cat Tracker was singular in its scale—nearly a thousand cats across four countries wore GPS trackers for a week to shed light on how far they range and where they go.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>After six years, the results are in. Published in the journal Animal Conservation, a new report the Cat Tracker team compiled data across continents to find that for most cats, there’s no place like home.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>“I was surprised at how little these cats moved,” says lead author Roland Kays of the North Carolina Museum of Natural Sciences. “Most of them spent all their time within 100 meters [330 feet] of their yard.” While it’s good news that most cats aren’t wandering into natural areas, the study reveals that pet cats nonetheless can cause ecological mayhem and put themselves in danger. (Read more about following in the footsteps of felines here.)</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Michael Cove, a cat expert at the Smithsonian Conservation Biology Institute who studied the effects of feral and free-roaming cats on endangered small mammals in the Florida Keys, lauded the study as “quite an accomplishment.”&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->','cats','','inherit','closed','closed','','10-revision-v1','','','2020-05-31 07:48:34','2020-05-31 07:48:34','',0,'http://example.org/?p=7',0,'revision','',0),
	(8,0,'2020-05-31 07:48:34','2020-05-31 07:48:34','<!-- wp:paragraph -->\n<p>As the saying goes, dogs are humans\' best friends, but that doesn\'t mean that they always enjoy being in every environment with you. According to Medical News Today, many of our canine companions are living with anxiety. In a study published in Scientific Reports, the lead researcher Milla Salonen and other members of her team studied the behaviors of over 13,000 pet dogs in Finland and found that 72.5 percent of them exhibited anxious traits.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>To gather the data for the study, the researchers enlisted the dogs\' owners to answer behavior questionnaires in relation to seven anxiety qualities: noise sensitivity, general fear, fear of surfaces, impulsivity or lack of attention, compulsive behaviors, aggression, and separation anxiety. After reading through the owners\' responses on behalf of 264 different breeds, noise sensitivity ranked as the highest stressor at 32 percent. The highest noise trigger? Fireworks, which caused fear in 26 percent of pups.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Related: The Best Dog Breed for You, Based on Your Personality Type</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>All in all, general fear prompted anxiety in 29 percent of the pets. "Specifically, 17 percent of dogs showed fear of other dogs, 15 percent fear of strangers, and 11 percent fear of novel situations," the researchers added. The dogs\' breeds also played a major role in how they reacted to certain anxiety triggers—mixed breed dogs being some of the most with sensitivity towards noise.</p>\n<!-- /wp:paragraph -->','the dogs','','inherit','closed','closed','','12-revision-v1','','','2020-05-31 07:48:34','2020-05-31 07:48:34','',0,'http://example.org/?p=8',0,'revision','',0),
